import React from 'react';
import './Carousel.css'; // Stilizatsija za Carousel

const Carousel = ({ pictures, onNext, onPrev }) => {
  return (
    <div className="carousel">
      <button className="prev" onClick={onPrev}>&#8249;</button>
      <img src={pictures} alt="Property" />
      <button className="next" onClick={onNext}>&#8250;</button>
    </div>
  );
};

export default Carousel;
